using System;

namespace ConsoleApp24
{
    internal class Program
    {
        static void Main(string[] args)
        {
            Random random = new Random();
            int[] numbers = new int[30];
            int maximumNumber = 9;
            int startComparison = 1;
            int startRepeat = 1;
            int numberRepeate = 1;
            int maximumRepetitionsNumber = 0;
            int repeatingNumber = 0;

            for (int i = 0; i < numbers.Length; i++)
            {
                numbers[i] = random.Next(maximumNumber - 1);
            }

            for (int i = 0; i < numbers.Length; i++)
            {
                Console.Write(numbers[i]);
            }

            Console.WriteLine();

            for (int i = startComparison; i < numbers.Length; i++)
            {
                if (numbers[i] == numbers[i - 1])
                {
                    numberRepeate++;

                    if (numberRepeate > maximumRepetitionsNumber)
                    {
                        maximumRepetitionsNumber = numberRepeate;
                        repeatingNumber = numbers[i];
                    }
                }
                else
                {
                    numberRepeate = startRepeat;
                }
            }

            Console.WriteLine($"–ß–∏—Å–ª–æ {repeatingNumber} –ø–æ–≤—Ç–æ—Ä–∏–ª–æ—Å—å {maximumRepetitionsNumber} —Ä–∞–∑. ");
        }
    }
}

#include <iostream>
#include <sstream>
#include <string>
#include <stack>

using namespace std;

int main() {
    string line;
    getline(cin, line);

    int quantity, dress, racks = 1, sum = 0;
    cin >> quantity;

    stack<int> clothes;

    istringstream ss(line);

    while (ss >> dress) {
        clothes.push(dress);
    }

    while (!clothes.empty()) {
        sum += clothes.top();
        if (sum <= quantity) {
            clothes.pop();
        }
        else {
            racks++;
            sum = 0;
        }
    }

    cout << racks << endl;
    return 0;
}

#include <algorithm>
#include <iostream>
#include <set>
#include <string>
#include <vector>

using namespace std;

int Fibonacci(int x){
    if(x == 0){
        return 0;
    }
    if(x == 1){
        return 1;
    }

    return Fibonacci(x-1) + Fibonacci(x-2);
}

int main() {
    cout << Fibonacci(6) << endl;
}

