void EraseAndPrint(Container& container, int start_position, int start_r, int end_r) {
    container.erase(container.begin() + start_position);
    PrintRange(container.begin(), container.end());
    container.erase(container.begin() + start_r, container.begin() + end_r);
    PrintRange(container.begin(), container.end());
}

